  - - !str 11
    - info_override_scale
    - |-
      If checked, you can use a different scale and/or key for this section from the scale and key which is set for the entire piece. This can be used to put a section in a different key or tonality (i.e. major or minor). 

      However, take care when selecting a scale with a different number of pitches, as the results are a bit unpredictable. For example, if the scale set for the piece is a major scale (with 7 different pitches) a pentatonic scale (with 5 pitches) should not be used here.
